import React from 'react'
import '../css/skills.css';
import 'bootstrap/dist/css/bootstrap.min.css';
const Skills = ()=>{
  return (
    <>

        <section class="skills">
            <div className='container'>
            <div class="main-text">
                {/* <span>Technical and Professional</span> */}
                <h2>My Skills</h2>
            </div>
               
                <div class="progress ">
                   <div class="progress-bar progress-bar-success progress-bar-striped active" role="progressbar" aria-valuenow="80" aria-valuemin="0" aria-valuemax="100" style={{width: "80%"}}>HTML 80%</div>
                 </div> 
                 <div class="progress">
                    <div class="progress-bar progress-bar-info progress-bar-striped active" role="progressbar" aria-valuenow="70" aria-valuemin="0" aria-valuemax="100" style={{width: "70%"}}>CSS 75%</div>
                 </div>   
